import React, { useState } from 'react';

export default function Thirdbar() {
  const [searchQuery, setSearchQuery] = useState('');

  const handleInputChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(`http://localhost:5000/api/search?q=${searchQuery}`, {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        }
      });

      if (response.ok) {
        const data = await response.json();
        console.log('Search results:', data);
      } else {
        console.error('Error submitting search query');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div className="container g-0">
      <div className="row">
        <div className="col-8">
          <form onSubmit={handleSubmit}>
            <input
              type="text"
              placeholder="Search"
              className="input-group mx-2 my-4 rounded-pill p-2 bg-dark text-white border-primary"
              value={searchQuery}
              onChange={handleInputChange}
            />
            <button type="submit" className="btn btn-primary rounded-pill mx-2 my-4">Search</button>
          </form>
        </div>
      </div>
    </div>
  );
}
